import { Route, Routes } from "react-router";
import React from 'react';

const AppRouter = () => {
    return (
        <Routes>
            {routes.map(route =>
                <Route
                    component={route.component}
                    path={route.path}
                    exact={route.exact}
                />
            )}
        </Routes>
    )
}

export default AppRouter;
